import{_ as a,c as s,o as t,ag as o}from"./chunks/framework.Ds6Eueu6.js";const h=JSON.parse('{"title":"DROP RESOURCE QUEUE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_RESOURCE_QUEUE.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_RESOURCE_QUEUE.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_RESOURCE_QUEUE.md"};function n(r,e,l,p,c,d){return t(),s("div",null,e[0]||(e[0]=[o(`<h1 id="drop-resource-queue" tabindex="-1">DROP RESOURCE QUEUE <a class="header-anchor" href="#drop-resource-queue" aria-label="Permalink to &quot;DROP RESOURCE QUEUE&quot;">​</a></h1><p>Removes a resource queue.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP RESOURCE QUEUE &lt;queue_name&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p>This command removes a resource queue from WarehousePG. To drop a resource queue, the queue cannot have any roles assigned to it, nor can it have any statements waiting in the queue. Only a superuser can drop a resource queue.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>queue_name : The name of a resource queue to remove.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>Use <a href="./ALTER_ROLE.html">ALTER ROLE</a> to remove a user from a resource queue.</p><p>To see all the currently active queries for all resource queues, perform the following query of the <code>pg_locks</code> table joined with the <code>pg_roles</code> and <code>pg_resqueue</code> tables:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SELECT rolname, rsqname, locktype, objid, pid, </span></span>
<span class="line"><span>mode, granted FROM pg_roles, pg_resqueue, pg_locks WHERE </span></span>
<span class="line"><span>pg_roles.rolresqueue=pg_locks.objid AND </span></span>
<span class="line"><span>pg_locks.objid=pg_resqueue.oid;</span></span></code></pre></div><p>To see the roles assigned to a resource queue, perform the following query of the <code>pg_roles</code> and <code>pg_resqueue</code> system catalog tables:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>SELECT rolname, rsqname FROM pg_roles, pg_resqueue WHERE </span></span>
<span class="line"><span>pg_roles.rolresqueue=pg_resqueue.oid;</span></span></code></pre></div><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove a role from a resource queue (and move the role to the default resource queue, <code>pg_default</code>):</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER ROLE bob RESOURCE QUEUE NONE;</span></span></code></pre></div><p>Remove the resource queue named <code>adhoc</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP RESOURCE QUEUE adhoc;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>The <code>DROP RESOURCE QUEUE</code> statement is a WarehousePG extension.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_RESOURCE_QUEUE.html">ALTER RESOURCE QUEUE</a>, <a href="./CREATE_RESOURCE_QUEUE.html">CREATE RESOURCE QUEUE</a>, <a href="./ALTER_ROLE.html">ALTER ROLE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,24)]))}const E=a(i,[["render",n]]);export{h as __pageData,E as default};
